    fn send_request(&mut self, request: &Message) -> Result<Option<Message>, Box<dyn Error>>;
    fn recv_response(&mut self) -> Result<Option<Message>, Box<dyn Error>>;
}

impl<T: ProtobufServer> ProtobufClient for T {
    fn send_request(&mut self, request: &Message) -> Result<Option<Message>, Box<dyn Error>> {
        self.handle_request(request).map(|response| response.map(|r| r.into()))
    }

    fn recv_response(&mut self) -> Result<Option<Message>, Box<dyn Error>> {
        self.handle_request(Message::new()).map(|response| response.map(|r| r.into()))
    }
